import NavBar from '../../components/navbar/NavBar';
import RoomList from '../../components/roomList/RoomList';
import SideBar from '../../components/sidebar/SideBar';
import './Room.css';

const Room = () => {
  return (
    <div className="container">
      <SideBar />
      <div>
        <NavBar />
        <div className="pageContent">
          <RoomList/>
        </div>
      </div>
    </div>
  );
};

export default Room;
